import { ObjectLiteral } from "../../models/types"

export const RECEIVE_TICKETS = "RECEIVE_TICKETS"

export function receiveTickets(tickets: ObjectLiteral[]): ObjectLiteral {
  return {
    type: RECEIVE_TICKETS,
    tickets,
  }
}
